'''Mystery boxes '''can be obtained from the [[Quiz Master]] [[Random events|random event]]. Players can choose between 1,000 coins or the mystery box upon successfully completing the random event. The box contains a random selection of items. If at all possible, it is recommended to wear a [[ring of wealth]] before opening this box, because of the significant chance to roll on the [[Rare Drop Table]]. Doing this (along with completing all owned clue scrolls before opening the box) will make it possible to completely eliminate the chance to receive nothing from this box. On the island of [[Entrana]], the usual [[mithril scimitar]] drop is replaced by five [[mithril bar]]s, and the [[steel platebody]] drop is replaced by five [[steel bar]]s. This does not however occur while challenging Koschei the deathless, and the box can be used to gain an extra advantage from its weapon and armour drops. This item is bankable.

